def return_vowels(string):
    vowels = ['a', 'e', 'i', 'o', 'u']
    result = []

    for char in string[10:82]:
        if char in vowels and char > '$' and char <= '@':
            result.append(char)

    return result
```
Note: The code assumes that the input string has a length of at least 82 characters. If the string is shorter than that, you may need to handle the edge case accordingly.
